import React, { useState } from 'react';

function App() {
  const [selectedStock, setSelectedStock] = useState(null);

  const handleStockSelection = (stock) => {
    setSelectedStock(stock);
  };

  return (
    <div className="bg-gray-100 min-h-screen">
      <header className="p-6 bg-blue-600 text-white">
        <h1 className="text-xl">Stock Price Forecasting Dashboard</h1>
      </header>
      <main className="p-6">
        <h2>Select a Stock</h2>
        {/* sample stock */}
        <button onClick={() => handleStockSelection('AAPL')}>
          Select Apple (AAPL)
        </button>
        <p>{selectedStock ? `You selected: ${selectedStock}` : 'No stock selected'}</p>
      </main>
    </div>
  );
}

export default App;
